import React from "react";
import "./Projects.css";

const Projects = () => {
  const projects = [
    {
      title: "Colors Of Rajasthan",
      description: "A travel website providing information about tourist places in Rajasthan.",
      technologies: "PHP, MySQL, HTML",
    },
    {
      title: "Kids World",
      description: "An Android app with learning pages and activities for kids.",
      technologies: "Java, XML",
    },
    {
      title: "To-Do Application",
      description: "A web app for task management with CRUD functionality.",
      technologies: "HTML, CSS, JavaScript",
    },
  ];

  return (
    <section className="projectsContainer" id="projects">
      <h2>Projects</h2>
      <div className="projectList">
        {projects.map((project, index) => (
          <div key={index} className="projectItem">
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <p><strong>Technologies:</strong> {project.technologies}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
